import http from './base-http-service';

const createGroup = (user) => http.post('/login', user)
  .then(response => response.data);

const register = (user) => http.post('/register', user)
  .then(response => response.data);

const logout = () => http.get('/logout')
  .then(response => response.data);

export default {
  login,
  register,
  logout
}
